import React from "react";
import { FormControl, FormGroup, Input, InputLabel, Typography, Button, styled } from "@mui/material";


const ContainerStyle = styled(FormGroup)({
	width: "50%",
    margin: "5rem auto",
    "& > div" : {
        marginTop: "1.5rem"
    }
});



const LoginPage = () => {
	const handleValueChange = () => {
		console.log("Value Changed");
	};

	const handleClick = () => {
		console.log("Button Clicked");
	};

	return (
		<ContainerStyle>
			<Typography variant="h4" align="center" gutterBottom>
				{" "}
				Login{" "}
			</Typography>

			<FormControl>
				<FormGroup>
					<InputLabel>Email</InputLabel>
					<Input type="email" placeholder="Enter Email" onChange={() => handleValueChange()} />
				</FormGroup>
			</FormControl>
			<FormControl>
				<FormGroup>
					<InputLabel>Password</InputLabel>
					<Input type="password" placeholder="Enter Password" onChange={() => handleValueChange()} />
				</FormGroup>
			</FormControl>
            
			<Button variant="contained" color="primary" onClick={() => handleClick()}>
				{" "}
				Login{" "}
			</Button>
		</ContainerStyle>
	);
};

export default LoginPage;
